import React from 'react';
import '../App.css';
import '../components/Resume.css';

function Resume() {
    return (
        <div className='resume-container'>
            <h2>Software Engineer</h2>
            <p>§ Promoted to Software Engineer on the third year of tenure at Infor.

  § Main focus as a developer was to maintain the current responsibilities and improve to advance my knowledge and skills to apply them in to creating the Pathway product.
  § Handled all of our Web Deployment using Microsoft Azure DevOps.
  § Bug Fixed High Level Framework and Form Level, and Customer Issues
  filed by the Quality Assurance.
  § Lead on a specific module and studied to be the Subject matter expert.
  § More advanced on the tools and Technologies used: C# .NET MVC, SQL
  Server, HTML, CSHTML, CSS, JavaScript, TypeScript, XML, Uniface.</p>
        </div>

    )
}

export default Resume
